window.bookSummaryJSON = "<p>The Final Game Begins</p> <p>Scarlett Sutara Aditya has finally learned the full cost to save her world and correct mistakes that are not hers, but she refuses to accept the fate that has been decided for her. Making demands of her own, she fights for her twin flame, her family, and the realm that balances on her destiny. She has always played games by her own rules, but this time, winning might cost her everything.</p> <p>The broken are remade. The lost are found. Fate is defied, and new destinies are forged as the realm comes together to defend what is theirs. Kings will fall, and Queens will rise. Power is lost, and Chaos is born. Truth can be uncovered in the darkness, but some secrets can only be found among the stars.</p> <p>This is the fifth and final book in the Lady of Darkness series. It is a new adult, dark fantasy romance novel. It features slow-burn, enemies-to-lovers troupes and may have triggers of love-hate themes, sexual scenes, references to SA trauma, violence, and jealous/possessive themes. It is part of a series.</p>"; 
